import React from 'react';

export default class QuestionOne extends React.Component {
    render () {
        return (
            <form className="question-block">
                <div className="question-block__question">{this.props.question}</div>
                <p><input name="question" type="radio" value="first" /> {this.props.variants[0]}</p>
                <p><input name="question" type="radio" value="second" /> {this.props.variants[1]}</p>
                <p><input name="question" type="radio" value="third" /> {this.props.variants[2]}</p>
                <p><input type="submit" value="Выбрать" /></p>
            </form>
        )
    }
}
